package uz.gita.currencyconverter.diimport dagger.Bindsimport dagger.Moduleimport dagger.hilt.InstallInimport dagger.hilt.components.SingletonComponentimport uz.gita.currencyconverter.utils.navigation.AppNavigatorimport uz.gita.currencyconverter.utils.navigation.AppNavigatorDispatcherimport uz.gita.currencyconverter.utils.navigation.AppNavigatorHandlerimport javax.inject.Singleton@Module@InstallIn(SingletonComponent::class)interface NavigationModule {    @[Binds Singleton]    fun bindsAppNavigation(impl: AppNavigatorDispatcher): AppNavigator    @[Binds Singleton]    fun bindsAppNavHandler(impl: AppNavigatorDispatcher): AppNavigatorHandler}